using Composition as _Composition from '../db/Composition';
using Action as _Action from '../db/Action';
using Genre as _Genre from '../db/Genre';
using Artist as _Artist from '../db/Artist';

service odata {

  entity Users @(
		title: 'Composition',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Composition;

  entity Action @(
		title: 'Action',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Action;

    entity Genre @(
		title: 'Genre',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Genre;

    entity Artist @(
		title: 'Artist',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Artist;
}

using uuid from './Composition';

entity Action {
    key guid : uuid;
    name : String(100);
};

using Action from './Action';
using Composition from './Composition';
using uuid from './Composition';

entity Artist {
    key guid : uuid;
    name : String(100);

    toAction : Association to many Action on toAction.guid = guid;
    toComposition : Association to many Composition on toComposition.guid = guid;
};

using Artist from './Artist';
using Genre from './Genre';

type uuid : String(32);

entity Composition {
    key guid : uuid;
    name : String(100);

    toArtist : association to one Artist on toArtist.guid = guid;
    toGenre : Association to one Genre on toGenre.name = name;
};

entity Genre {
    key name : String(50);
    description : String(100);
};
